

class Solution:
    def findMaxLength(self, nums):
        pass
        zeros = [0]*(len(nums)+1)
        if nums[0] == 0:
            zeros[0] = 1
        for i in range(len(nums)):
            if nums[i] == 0:
                zeros[i+1] = zeros[i] + 1
            else:
                zeros[i+1] = zeros[i]
        mx = 0
        
        for i in range(len(nums)):
            for j in range(i+mx+1, len(nums)):
                if (j-i)%2 == 0:
                    continue
                cnt_zero = zeros[j+1]-zeros[i]
                cnt_ones = j-i+1-cnt_zero
                if zeros[j+1]-zeros[i] == cnt_ones:
                    mx = max(mx, j-i+1)        
        return mx
                        
        
